import React from 'react';
import Home from './Home';
import Transfer from './Transfer';
export default function Account({category}) {
  const setCategory = (category) => {
    if (category === 'home') {
      return <Home/>
    }
    else if (category === 'transfer') {
      return <Transfer/>
    }
  }
  return (
    <div>
      {setCategory(category)}
    </div>
  )
}
